			var client_id = event.data;

			if ((origin.substr(-13) != '.flaticon.com') && (origin.substr(-12) != '.freepik.com')) return;

			$('a.preview').each(function() {
				$(this).attr('href', $(this).attr('href') + '&client_id=' + client_id);
			});
		});
	</script>

</body></html>
